// 点element显示 halo
paper.on('element:pointerclick', function(elementView) {
	var handles = [{
			name: 'remove',
			position: 'nw',
			events: {
				pointerdown: 'removeElement'
			}
		},
		{
			name: 'link',
			position: 'e',
			events: {
				pointerdown: 'startLinking',
				pointermove: 'doLink',
				pointerup: 'stopLinking'
			}
		}
	];
	if(elementView.model.attributes.type === 'domain.entity'){
		handles.push({
			name: 'change',
				position: 'sw',
				icon: 'data:image/jpg;base64,'	
		});
	}
	var halo = new joint.ui.Halo({
		cellView: elementView,
		handles: handles
	}).render();
	halo.on('action:link:add', function(link) {
		var sourceId = link.get('source').id;
		var targetId = link.get('target').id;
		var sourceType = getTypeById(sourceId);
		var targetType = getTypeById(targetId);

		if (!sourceId || !targetId || (sourceType ===
				'machine.entity' && targetType === 'requirement.entity') || (sourceType === 'requirement.entity' && targetType ===
				'machine.entity') || (sourceType ===
				'requirement.entity' && targetType === 'requirement.entity')) {
			link.remove();
		} else if ((sourceType ===
				'domain.entity' && targetType === 'requirement.entity') || (sourceType === 'requirement.entity' && targetType ===
				'domain.entity')) {
			changeInterfaceToReference(link);
		}
	});
	halo.on('action:change:pointerdown', function(evt) {
		changeDesignAnGiven(elementView.model);
	});
});


// 点link显示link上的tool
paper.on('link:pointerup', function(linkView) {
	paper.removeTools();
	var toolsView = new joint.dia.ToolsView({
		name: 'my-link-tools',
		tools: [
			new joint.linkTools.Remove({
				offset: -20,
				distance: 40
			})
		]
	});
	linkView.addTools(toolsView);
	var link = linkView.model;
	if (link.attributes.type === 'reference.CustomLink' || link.attributes.type === 'constraint.CustomLink') {
		var handles = [{
			name: 'change',
			position: 'ne',
			icon: 'data:image/jpg;base64,'
		}, {
			name: 'addphe',
			position: 'nw',
			icon: 'data:image/jpg;base64,',
		}, ];
		var halo = new joint.ui.Halo({
			cellView: linkView,
			handles: handles,
			//type:'toolbar'
		}).render();
		halo.on('action:change:pointerdown', function(evt) {
			changeReferenceAndConstraint(link);
		});
		halo.on('action:addphe:pointerdown', function(evt) {
			phenomenon(link);
		});
	} else if (link.attributes.type === 'interface.CustomLink') {
		var handles = [{
			name: 'addphe',
			position: 'nw',
			icon: 'data:image/jpg;base64,'
		}];
		var halo = new joint.ui.Halo({
			cellView: linkView,
			handles: handles,
			//type:'toolbar'
		}).render();
		halo.on('action:addphe:pointerdown', function(evt) {
			phenomenon(link);
		});
	}

});
//点空白处
paper.on('blank:pointerdown', function() {
	paper.removeTools();
});